import React from 'react';
import { Link } from 'react-router-dom';

// Header Component
const Header = () => (
  <header style={{
    background: 'linear-gradient(45deg, #667eea, #764ba2)',
    color: 'white',
    padding: '20px 0',
    textAlign: 'center',
    marginBottom: '40px'
  }}>
    <h1 style={{ fontSize: '2.5rem', margin: '0' }}>Modern React Website</h1>
    <p style={{ fontSize: '1.2rem', margin: '10px 0 0 0', opacity: 0.9 }}>
      Built with React Components and Modern Styling
    </p>
  </header>
);

// Feature Card Component
const FeatureCard = ({ icon, title, description }) => (
  <div className="card" style={{ textAlign: 'center', margin: '20px' }}>
    <div style={{
      fontSize: '3rem',
      marginBottom: '20px',
      color: '#667eea'
    }}>
      {icon}
    </div>
    <h3 style={{ color: '#333', marginBottom: '15px' }}>{title}</h3>
    <p style={{ color: '#666', lineHeight: '1.6' }}>{description}</p>
  </div>
);

// Hero Section Component
const HeroSection = () => (
  <section style={{
    background: 'white',
    borderRadius: '16px',
    padding: '60px 40px',
    textAlign: 'center',
    marginBottom: '40px',
    boxShadow: '0 8px 32px rgba(0, 0, 0, 0.1)'
  }}>
    <h2 style={{ fontSize: '2.5rem', color: '#333', marginBottom: '20px' }}>
      Welcome to Our Amazing Website
    </h2>
    <p style={{ fontSize: '1.2rem', color: '#666', marginBottom: '30px', maxWidth: '600px', margin: '0 auto 30px' }}>
      This is a beautiful React website showcasing modern web development practices with reusable components and stunning design.
    </p>
    <div style={{ display: 'flex', gap: '20px', justifyContent: 'center', flexWrap: 'wrap' }}>
      <button className="btn" style={{ fontSize: '1.1rem', padding: '15px 30px' }}>
        Get Started
      </button>
      <button className="btn" style={{ 
        fontSize: '1.1rem', 
        padding: '15px 30px',
        background: 'transparent',
        border: '2px solid #667eea',
        color: '#667eea'
      }}>
        Learn More
      </button>
    </div>
  </section>
);

// Stats Component
const Stats = () => {
  const stats = [
    { number: '1000+', label: 'Happy Clients' },
    { number: '500+', label: 'Projects Completed' },
    { number: '50+', label: 'Team Members' },
    { number: '24/7', label: 'Support' }
  ];

  return (
    <section style={{
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))',
      gap: '30px',
      marginBottom: '40px'
    }}>
      {stats.map((stat, index) => (
        <div key={index} style={{
          background: 'white',
          borderRadius: '12px',
          padding: '30px',
          textAlign: 'center',
          boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)'
        }}>
          <div style={{ fontSize: '2.5rem', fontWeight: 'bold', color: '#667eea', marginBottom: '10px' }}>
            {stat.number}
          </div>
          <div style={{ color: '#666', fontSize: '1.1rem' }}>
            {stat.label}
          </div>
        </div>
      ))}
    </section>
  );
};

// Footer Component
const Footer = () => (
  <footer style={{
    background: '#333',
    color: 'white',
    padding: '40px 0',
    textAlign: 'center',
    marginTop: '60px',
    borderRadius: '16px 16px 0 0'
  }}>
    <div style={{ marginBottom: '20px' }}>
      <h3 style={{ marginBottom: '10px' }}>React Exercises Lab</h3>
      <p style={{ opacity: 0.8 }}>Building amazing web experiences with React</p>
    </div>
    <div style={{ display: 'flex', justifyContent: 'center', gap: '20px', flexWrap: 'wrap' }}>
      <Link to="/" className="btn" style={{ background: '#667eea' }}>
        Back to Home
      </Link>
    </div>
  </footer>
);

function Exercise1() {
  const features = [
    {
      icon: '⚛️',
      title: 'React Components',
      description: 'Modular and reusable components that make development efficient and maintainable.'
    },
    {
      icon: '🎨',
      title: 'Modern Design',
      description: 'Beautiful and responsive design that works perfectly on all devices.'
    },
    {
      icon: '⚡',
      title: 'Fast Performance',
      description: 'Optimized for speed with modern React features and best practices.'
    },
    {
      icon: '🔧',
      title: 'Easy Maintenance',
      description: 'Clean code structure that makes updates and modifications simple.'
    }
  ];

  return (
    <div className="container">
      <Header />
      
      <HeroSection />
      
      <div style={{ marginBottom: '40px' }}>
        <h2 style={{ 
          textAlign: 'center', 
          fontSize: '2rem', 
          color: '#333', 
          marginBottom: '40px' 
        }}>
          Our Features
        </h2>
        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
          gap: '30px'
        }}>
          {features.map((feature, index) => (
            <FeatureCard key={index} {...feature} />
          ))}
        </div>
      </div>
      
      <Stats />
      
      <Footer />
    </div>
  );
}

export default Exercise1;
